import React from 'react'

export default function Logout() {
    React.useEffect(() => {
        Axios.get("http://localhost:3001/user/logout").then((response) => {
            console.log(response);
            if (response.data.loggedIn == true) {
                console.log("Logout successfully");
            }
        })
    }, []);
}
